geregisseerd door Andrew Semans
met Novella Nelson, Rebecca Lawrence en Eleonore Hendricks

Paul is een getalenteerd student die bijna klaar is op de universiteit van Yale en zojuist ingetrokken bij zijn vriendin Jen. Een mooie toekomst lijkt in het verschiet te liggen. Hij heeft echter het boek 'Little Dorrit' van Dickens met al zijn aantekeningen daarin, vergeten, en zonder kan hij zijn proefschrift niet voltooien. Hij moet terug naar zijn oude kamer en daarbij de confrontatie aangaan met zijn voormalige kamergenoot Nancy. Deze wil echter niet meewerken, en Paul wordt boos en obsessief. Maar het moet nog veel erger worden, wil hij de situatie kunnen oplossen...



